import './App.css';
import Customer from './components/Customer';

const customers = [
{
  'id':1,
  'img' : 'https://placeimg.com/64/64/1',
  'name' : '김태희',
  'birthday' : '931018',
  'gender' : '남자',
  'job' : '개발'

},
{
  'id':2,
  'img' : 'https://placeimg.com/64/64/2',
  'name' : '홍길동',
  'birthday' : '950318',
  'gender' : '남자',
  'job' : '대학생'

}, 
{
  'id':3,
  'img' : 'https://placeimg.com/64/64/3',
  'name' : '장다혜',
  'birthday' : '910907',
  'gender' : '여자',
  'job' : '디자이너'

}
]

function App() {
  return (
    <div>
      {
        customers.map(c => {
          return(
            <Customer
              key={c.id}
              id={c.id}
              img={c.img}
              name={c.name}
              gender={c.gender}
              birthday={c.birthday}
              job={c.job}


          />
          ) 
        })
      }
    </div>

  );
}

export default App;
